example_labels = [x[0] for x in examples]
example_inputs = np.array([x[1] for x in examples])
n_features = example_inputs.shape[1]
all_labels = sorted(set(example_labels))
n_labels = len(all_labels)
label_numeric_index = dict(zip(all_labels, range(n_labels)))

def test(w, inputs, labels):
    n_inputs = inputs.shape[0]
    mislabeled = 0
    for i in range(n_inputs):
        f = (w * example_inputs[i]).sum(1)
        label_estimated = f.argmax()
        label_ground_truth = label_numeric_index[labels[i]]
        if label_estimated != label_ground_truth:
            mislabeled += 1
    return mislabeled

def train(w_initial, inputs, labels, maxiter=1000):
    n_inputs = inputs.shape[0]
    w = w_initial.copy()
    mislabeled = 1
    while mislabeled and maxiter > 0:
        mislabeled = 0
        for i in range(n_inputs):
            f = (w * inputs[i]).sum(1)
            label_estimated = f.argmax()
            label_ground_truth = label_numeric_index[labels[i]]
            if label_estimated != label_ground_truth:
                w[label_ground_truth] += inputs[i]
                w[label_estimated] -= inputs[i]
                mislabeled += 1
        maxiter -= 1
    return w

weights_shape = (n_labels, n_features)

w_zero = train(np.zeros(weights_shape), example_inputs, example_labels)
print(test(w_zero, example_inputs, example_labels))

w_randomized = np.zeros(weights_shape)
n_initializations = 1000
maxiter = 200
for i in range(n_initializations):
    w_randomized += train(np.random.standard_normal(weights_shape), example_inputs, example_labels, maxiter)
    if i % 10 == 0:
        print('%d/%d' % (i, n_initializations))

w_randomized /= n_initializations

code = ""
code += '#define N_LABELS %d\n' % n_labels
code += '#define N_FEATURES %d\n' % n_features
code += 'static const double weights[N_LABELS][N_FEATURES] = {\n    {' + '},\n    {'.join(', '.join('%+.5f' % weight for weight in row) for row in w_randomized) + '}\n};\n'
code += 'static NSString *const labels[N_LABELS+1] = {' + ', '.join('@"%s"' % l for l in (all_labels + ['?'])) + '};\n'
print(code)
